import React, {useState} from 'react'
import { evaluate } from 'mathjs'

export default function Calculator() {

    const operators = {
        multiply: '*',
        divide: '/',
        add: '+',
        subtract: '-'
    }

    const [numbers, setNumbers] = useState([
        {
            num: '0',
            rightOp: null,
            deci: false,
            isNeg: false
        }
    ])
    const [currentInd, setCurrentInd] = useState(0)
    const [dispText, setDispText] = useState('0')
    const [lastInput, setLastInput] = useState(null)


    function checkNumValid(num) {
        const zeroOnlyRegex = /^0+$/;
        const zeroRegex = /^0+[123456789]+/;
        const emptyDeci = /^./;

        if(zeroOnlyRegex.test(num)) {
            return '0'
        } else if (zeroRegex.test(num)) {
            let match = num.match(zeroRegex)
            return match[0].replace(/0+/, '') + num.slice(match.index + match[0].length, num.length)
        } else if (emptyDeci.test(num)) {
            return '0' + num
        } else {
            return num
        }
    }

    function buildNumber(event) {
        setLastInput('number')

        let currentNum = numbers[currentInd]
        let val = event.target.value;


        if (val === '.') {
            if (!currentNum.deci) {
                currentNum = {
                    ...currentNum,
                    num: currentNum.num + val,
                    deci: true
                }
                setNumbers([currentNum])
            }
        } else if (val === '-') {
            if (!currentNum.isNeg) {
                if (currentNum.num === '0') {
                    currentNum = {
                        ...currentNum,
                        num: '1',
                        isNeg: true
                    }
                } else {
                    currentNum = {
                        ...currentNum,
                        isNeg: true
                    }
                    setNumbers([currentNum])
                }
            }
        } else if (currentNum.num === '0') {
            if (val !== '0') {
                currentNum = {
                    ...currentNum,
                    num: val
                }
                setNumbers([currentNum])
            }
        } else {
            
            currentNum = {
                ...currentNum,
                num: currentNum.num + val
            }
            setNumbers([currentNum])
        }

        if (currentNum.isNeg) {
            setDispText('-' + currentNum.num)
        } else {
            setDispText(currentNum.num)
        }
    } 

    return (
        <div id="calculator">
            <div id="display-container">
                <p id="full-exp">test</p>
                <p id="display">{dispText}</p>
            </div>

            <div id="buttons-container">
                <button id="clear">AC</button>
                <button id="divide" value='/'>/</button>
                <button id="multiply" value='*'>x</button>
                <button id="add" value='+'>+</button>
                <button id="subtract" onClick={buildNumber} value='-'>-</button>
                <button id="equals">=</button>

                <button id="zero" value={'0'} onClick={buildNumber}>0</button>
                <button id="one" value={'1'} onClick={buildNumber}>1</button>
                <button id="two" value={'2'} onClick={buildNumber}>2</button>
                <button id="three" value={'3'} onClick={buildNumber}>3</button>
                <button id="four" value={'4'} onClick={buildNumber}>4</button>
                <button id="five" value={'5'} onClick={buildNumber}>5</button>
                <button id="six" value={'6'} onClick={buildNumber}>6</button>
                <button id="seven" value={'7'} onClick={buildNumber}>7</button>
                <button id="eight" value={'8'} onClick={buildNumber}>8</button>
                <button id="nine" value={'9'} onClick={buildNumber}>9</button>

                <button id="decimal" value={'.'} onClick={buildNumber}>.</button>
            </div>
        </div>
    )
}


